    age : 25,
    Skill :'Web Developer'


 },
 {
    id : 1,
    name :'Adnan',
    age : 24,
    Skill :'SEO'


 }

]


const result = employeeList.map (names => < Persons person = {names} />)

return <div>{result}</div>




}

export default ListRendering;
